import axios from "axios";
import { BASE_URL } from "./settings";

const URLS = {
  TYPE_SERVICES: BASE_URL + "type-services"
};

export default class ServiceTypeService {
  static addServiceType = async (serviceType, token) => {
    let config = {
      headers: {
        Authorization: `Bearer ${token}`
      }
    };
    let url = URLS.TYPE_SERVICES;
    try {
      const { data } = await axios.post(url, serviceType, config);
      return data;
    } catch (err) {
      return err;
    } finally {
      // this.setState({ loading: false });
    }
  };

  static getServiceTypes = async token => {
    let config = {
      headers: {
        Authorization: `Bearer ${token}`
      }
    };
    try {
      const { data } = await axios.get(URLS.TYPE_SERVICES, config);
      return data;
    } catch (err) {
      return err;
    } finally {
      // this.setState({ loading: false });
    }
  };

  static getServiceType = async (id, token) => {
    let config = {
      headers: {
        Authorization: `Bearer ${token}`
      }
    };
    let url = URLS.TYPE_SERVICES + "/" + id;
    try {
      const { data } = await axios.get(url, config);
      return data;
    } catch (err) {
      return err;
    } finally {
      // this.setState({ loading: false });
    }
  };

  static updateServiceType = async (serviceType, token) => {
    let config = {
      headers: {
        Authorization: `Bearer ${token}`
      }
    };
    let url = URLS.TYPE_SERVICES;

    try {
      const { data } = await axios.put(url, serviceType, config);
      return data;
    } catch (err) {
      return err;
    } finally {
      // this.setState({ loading: false });
    }
  };

  static deleteServiceType = async (token, id) => {
    let config = {
      headers: {
        Authorization: `Bearer ${token}`
      }
    };
    let url = URLS.TYPE_SERVICES + "/" + id;

    try {
      const { data } = await axios.delete(url, config);
      return data;
    } catch (err) {
      return err;
    } finally {
      // this.setState({ loading: false });
    }
  };
}
